echSwarmEncounter:{title:"Blood Leech Swarm",description:"It only takes one mistake. One breach,<br>before what's contained becomes no longer;<br>A crack, a hairline fracture,<br>a single unforeseen failure,<br>and the boundaries are breached.<br><br>Now, they are free to consume.",mainEnemyEncounter:"bloodLeechSwarm",options:[{text:"FIGHT",description:"Initiates combat.",action:e=>{e.eventsStore.clearCurrentEventFromCacheAndBacklog(),e.battleInstanceStore.startBattle("bloodLeechSwarm",()=>{e.explorationStore.clearBlockerThisRun("specimenStorageBloodLeechSwarmCombatBlocker"),e.playerMovesStore.unlockMoveByID("vampiricSiphon"),e.metricsStore.incrementDefeatedEnemies(1),e.metricsStore.addPreviouslyDefeatedEnemy("bloodLeechSwarm")},()=>{})}},{text:"PREPARE",action:({eventsStore:e})=>{e.clearCurrentEventFromCacheAndBacklog()}}]},specimenStorageGnarledSalamanderEncounter:{title:"Gnarled Salamander",description:"It gorges itself.<br>Thick strands of corrupted flesh stretch from its jaws,<br>still squirming as it swallows.<br>A hiss escapes it. It shudders. Its bloated body pulses.<br><br>The skin weeps, yet wounds close as soon as they form.<br>Veins, once hidden, glow beneath its skin.<br>The air shimmers with toxins it exudes,<br>an invisible death creeping outward.<br><br>Its head snaps toward you.",mainEnemyEncounter:"gnarledSalamander",options:[{text:"FIGHT",description:"Initiates combat.",action:({eventsStore:e,battleInstanceStore:t})=>{e.clearCurrentEventFromCacheAndBacklog(),t.startBattle("gnarledSalamander",()=>{e.triggerImmediatelyFollowingEventOfId("specimenStorageGnarledSalamanderDefeated")},()=>{})}},{text:"PREPARE",action:({eventsStore:e})=>{e.clearCurrentEventFromCacheAndBacklog()}}]},specimenStorageGnarledSalamanderDefeated:{title:"Gnarled Salamander, Defeated",description:"The salamander is gone. Its body, ruined;<br>But remnants of the corrupted mass still remains.<br><br>The creature fed upon it. It changed.<br>Grew beyond what it should have been. Stronger. Harder to kill.<br><br>And you? You have already devoured so much,<br>more than you ever could have been meant to.<br>Grown faster, more powerful, more resilient.<br>Perhaps... this is no different?",options:[{text:"PRESS ON",description:"Unlocks Research Wing. Unlocks Aberrant Mass Collection.",action:({explorationStore:e,metricsStore:t,resourceStore:i,eventsStore:o})=>{e.clearBlockerThisRun("specimenStorageGnarledSalamanderCombatBlocker"),t.incrementDefeatedEnemies(1),t.addPreviouslyDefeatedEnemy("gnarledSalamander"),e.unlockExplorationZoneThisRunById("researchWing"),i.unlockResource("aberrantMass"),o.clearCurrentEventFromCacheAndBacklog()}}]},researchWingVoidAfflictedPatientEncounter:{title:"Void-Afflicted Patient",description:"An ID band dangles from a wrist too thin, too warped.<br>A name was written there. Unreadable now.<br><br>Once, they were subjects. Volunteers.<br>Those who sought escape from certain death.<br>Instead, they are here. Undying. Lost.<br>They see you. They move toward you.<br>Are they reaching for salvation?<br><br>Or for something else?",mainEnemyEncounter:"voidAfflictedPatient",options:[{text:"FIGHT",description:"Initiates combat.",action:({eventsStore:e,battleInstanceStore:t,explorationStore:i,metricsStore:o,playerMovesStore:s})=>{e.clearCurrentEventFromCacheAndBacklog();const d="voidAfflictedPatient";t.startBattle(d,()=>{i.clearBlockerThisRun("researchWingVoidAfflictedPatientCombatBlocker"),s.unlockMoveByID("exsanguinatingRake"),o.incrementDefeatedEnemies(1),o.addPreviouslyDefeatedEnemy(d)},()=>{})}},{text:"PREPARE",action:({eventsStore:e})=>{e.clearCurrentEventFromCacheAndBacklog()}}]},researchWingAberrantResearcherEncounter:{title:"Aberrant Researcher",description:"They wanted to save lives.<br>To find a cure. To stop the spread.<br>Rules, bent for progress; risks, taken for hope.<br>None of it mattered in the end.<br><br>Now, they are the sample.<br>A body swollen with unnatural growths,<br>the flesh beneath writhing.<br><br>They reach for you. Not for help. Not for salvation.<br>Only hunger.",mainEnemyEncounter:"aberrantResearcher",options:[{text:"FIGHT",description:"Initiates combat.",action:({eventsStore:e,battleInstanceStore:t,explorationStore:i,metricsStore:o,playerMovesStore:s})=>{e.clearCurrentEventFromCacheAndBacklog();const d="aberrantResearcher";t.startBattle(d,()=>{i.clearBlockerThisRun("researchWingAberrantResearcherCombatBlocker"),s.unlockMoveByID("experimentalTreatment"),o.incrementDefeatedEnemies(1),o.addPreviouslyDefeatedEnemy(d)},()=>{})}},{text:"PREPARE",action:({eventsStore:e})=>{e.clearCurrentEventFromCacheAndBacklog()}}]},researchWingAutonomousXenothreatSuppressionUnitEncounter:{title:"A.X.S.U.",description:"The turret machine stirs from dormancy.<br>A lens flickers to life, bathes the corridor in a pale red glow.<br><br><strong>XENOTHREAT DETECTION PROTOCOL ENGAGED.</strong><br><strong>STAND BY FOR BIOMETRIC VERIFICATION.</strong><br><br>A pause. Cold, clinical silence. A scan passes over you.<br>Metal whirs. Then, a shrill beep.<br><br>The machine has reached its conclusion.",mainEnemyEncounter:"autonomousXenothreatSuppressionUnit",options:[{text:"FIGHT",description:"Initiates combat.",hideIfUnavailable:!0,availableCondition:({organStore:e})=>e.currentEffectiveMutationStage!=="HUMAN",action:({eventsStore:e,battleInstanceStore:t})=>{e.clearCurrentEventFromCacheAndBacklog(),t.startBattle("autonomousXenothreatSuppressionUnit",()=>{e.triggerImmediatelyFollowingEventOfId("researchWingAutonomousXenothreatSuppressionUnitDefeatedNonhuman")},()=>{})}},{text:"FIGHT...?",description:"Initiates combat...?",hideIfUnavailable:!0,availableCondition:({organStore:e})=>e.currentEffectiveMutationStage==="HUMAN",action:({eventsStore:e})=>{e.triggerImmediatelyFollowingEventOfId("researchWingAutonomousXenothreatSuppressionUnitDefeatedHuman")}},{text:"PREPARE",action:({eventsStore:e})=>{e.clearCurrentEventFromCacheAndBacklog()}}]},researchWingAutonomousXenothreatSuppressionUnitDefeatedNonh